import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import logo from "./Images/logo.png";
import Image from "react-bootstrap/Image";
import { LinkContainer } from "react-router-bootstrap";



const NavbarComponent = () => {
  return (
    <div>
      <Image src={logo} className="logo" />
      <Navbar>
        <Container>
          <Nav>
            <LinkContainer to="/">
              <Nav.Link className="home">Home</Nav.Link>
            </LinkContainer>

            <LinkContainer to="/scheduleComponent">
              <Nav.Link className="home">Schedule</Nav.Link>
            </LinkContainer>

            <LinkContainer to="/learningComponent">
              <Nav.Link className="home">Learning</Nav.Link>
            </LinkContainer>

            <LinkContainer to="/profileComponent">
              <Nav.Link className="home">Profile</Nav.Link>
            </LinkContainer>

            <Nav.Link to="pricing" className="notice">
              Notification
            </Nav.Link>

            <LinkContainer to="/loginComponent">
              <Nav.Link className="login">Login in</Nav.Link>
            </LinkContainer>

            <LinkContainer to="/registerComponent">
              <Nav.Link className="signup">Sign Up</Nav.Link>
            </LinkContainer>
          </Nav>
        </Container>
      </Navbar>
    </div>
  );
};

export default NavbarComponent;
